import "./Expenses.css";
import ExpenseItems from "./ExpensItems";
import App from "../App";

function Expenses(props) {
    return (
        <div className="expenses">
            <ExpenseItems expense={props.items[0]}></ExpenseItems>
            <ExpenseItems expense={props.items[1]}></ExpenseItems>
            <ExpenseItems expense={props.items[2]}></ExpenseItems>
            <ExpenseItems expense={props.items[3]}></ExpenseItems>
        </div>
    );
}

export default Expenses;
